通过presentableId获取presentable数据资源的url；
通过resourceId[与presentableId]获取子资源的url；

参数
Object object



属性
类型
必填
说明




presentableId
String
是
节点资源ID


resourceId
String
否
 子资源ID



返回 - promise 
示例
// 获取子资源的url
FreelogApp.QI.resolveResourceUrl({ resourceId: 'be8c106c8ee0a85b67b95321353d98af92900a59' })
